import React, { Component } from "react";
import { regionURL } from "./constants";
import axios from "axios";
class Region extends Component {
  constructor(props) {
    super(props);
    this.state = {
      regionDetials: []
    };
    componentDidMount();
    {
      let regionDetials = [];
      axios.get(`${regionURL}`).then(result => {
        result.data.map(regionDetails => {
          // console.log(
          //   `data1 =` + regionDetails.carrier_code + ` data2 =` + regionDetails.carrier_full_name
          // );
          let temp = {
            regionId: regionDetails.regionId,
            region: regionDetails.region,
            environment: regionDetails.environment
          };
          regionDetials.push(temp);
        });
        this.setState({ regionDetials });
      });
    }
  }
  render() {
    return regionDetials.map(region => <h1>region.region</h1>);
  }
}

export default Region;
